import React, { useContext } from 'react';
import { Navbar, Nav, Button, Container } from 'react-bootstrap';
import { Context } from '../index';
import { useNavigate, useLocation } from 'react-router-dom';
import { ADMIN_ROUTE, LOGIN_ROUTE, SHOP_ROUTE, BASKET_ROUTE, REGISTRATION_ROUTE } from '../utils/consts';
import { observer } from 'mobx-react-lite';

const NavBar = observer(() => {
    const { user, device } = useContext(Context);
    const navigate = useNavigate();
    const location = useLocation();

    const logOut = () => {
        user.setUser({});
        user.setIsAuth(false);
        localStorage.removeItem('token');
        navigate(SHOP_ROUTE);
    };

    const handleHomeClick = () => {
        if (location.pathname === LOGIN_ROUTE || location.pathname === REGISTRATION_ROUTE) {
            return;
        }
        device.resetFilters();
        navigate(SHOP_ROUTE);
    };

    return (
        <Navbar
            style={{
                backgroundColor: '#f3f4f6', // Soft light gray for subtle, elegant tone (#f3f4f6 is Tailwind gray-100)
                borderBottom: '1px solid #e5e7eb',
                position: 'sticky',
                top: 0,
                zIndex: 1020,
                paddingTop: '1rem',
                paddingBottom: '1rem',
            }}
            expand="lg"
        >
            <Container style={{ maxWidth: 1300, display: 'flex', alignItems: 'center' }}>
                <Navbar.Brand
                    style={{
                        cursor: 'pointer',
                        fontWeight: 700,
                        fontSize: '1.75rem',
                        color: '#111827', // Dark gray, strong and elegant
                        userSelect: 'none',
                        letterSpacing: '-0.02em',
                        marginRight: 'auto',
                    }}
                    onClick={handleHomeClick}
                >
                    ТехноСфера
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav" className="justify-content-end">
                    <Nav style={{ alignItems: 'center', gap: '0.75rem' }}>
                        {user.isAuth ? (
                            <>
                                {user.user.role === 'ADMIN' && (
                                    <Button
                                        variant="outline-gray" // custom variant below via style prop
                                        className="rounded-pill px-4 py-2"
                                        onClick={() => navigate(ADMIN_ROUTE)}
                                        style={{
                                            fontWeight: 600,
                                            fontSize: '1rem',
                                            color: '#4b5563', // Tailwind gray-600 for subtle text
                                            borderColor: '#d1d5db', // Tailwind gray-300 border
                                            transition: 'background-color 0.3s, color 0.3s',
                                        }}
                                        onMouseEnter={e => {
                                            e.currentTarget.style.backgroundColor = '#e5e7eb'; // light hover background
                                            e.currentTarget.style.color = '#111827';
                                        }}
                                        onMouseLeave={e => {
                                            e.currentTarget.style.backgroundColor = 'transparent';
                                            e.currentTarget.style.color = '#4b5563';
                                        }}
                                    >
                                        Админ Панель
                                    </Button>
                                )}
                                <Button
                                    variant="outline-gray"
                                    className="rounded-pill px-4 py-2"
                                    onClick={() => navigate(BASKET_ROUTE)}
                                    style={{
                                        fontWeight: 600,
                                        fontSize: '1rem',
                                        color: '#4b5563',
                                        borderColor: '#d1d5db',
                                        transition: 'background-color 0.3s, color 0.3s',
                                        position: 'relative',
                                    }}
                                    onMouseEnter={e => {
                                        e.currentTarget.style.backgroundColor = '#e5e7eb';
                                        e.currentTarget.style.color = '#111827';
                                    }}
                                    onMouseLeave={e => {
                                        e.currentTarget.style.backgroundColor = 'transparent';
                                        e.currentTarget.style.color = '#4b5563';
                                    }}
                                >
                                    Корзина
                                    {/* Uncomment below to add badge */}
                                    {/* <span
                                        className="position-absolute top-0 start-100 translate-middle badge rounded-pill bg-red-500"
                                        style={{ fontSize: '0.7rem' }}
                                    >
                                        3
                                    </span> */}
                                </Button>
                                <Button
                                    variant="outline-danger"
                                    className="rounded-pill px-4 py-2"
                                    onClick={logOut}
                                    style={{
                                        fontWeight: 600,
                                        fontSize: '1rem',
                                    }}
                                    onMouseEnter={e => {
                                        e.currentTarget.style.backgroundColor = '#fca5a5'; // Tailwind red-300
                                        e.currentTarget.style.color = '#991b1b'; // Tailwind red-800
                                        e.currentTarget.style.borderColor = '#f87171'; // Tailwind red-400
                                    }}
                                    onMouseLeave={e => {
                                        e.currentTarget.style.backgroundColor = 'transparent';
                                        e.currentTarget.style.color = '#dc2626'; // Tailwind red-600
                                        e.currentTarget.style.borderColor = '#dc2626';
                                    }}
                                >
                                    Выйти
                                </Button>
                            </>
                        ) : (
                            <Button
                                variant="black"
                                className="rounded-pill px-4 py-2"
                                onClick={() => navigate(LOGIN_ROUTE)}
                                style={{
                                    fontWeight: 600,
                                    fontSize: '1rem',
                                    backgroundColor: '#111827', // Dark black
                                    color: '#ffffff',
                                    boxShadow: '0 2px 6px rgba(0,0,0,0.1)',
                                    border: 'none',
                                    transition: 'background-color 0.3s, color 0.3s',
                                }}
                                onMouseEnter={e => {
                                    e.currentTarget.style.backgroundColor = '#374151'; // Tailwind gray-700
                                }}
                                onMouseLeave={e => {
                                    e.currentTarget.style.backgroundColor = '#111827';
                                }}
                            >
                                Авторизация
                            </Button>
                        )}
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
});

export default NavBar;
